import styled from "styled-components";
import { motion } from "framer-motion";

const DshbordComponenetStyle = styled(motion.div)`
  display: flex;
  flex-direction: column;
  position: relative;
  width: auto;
  left: 5vw;
  width: 90vw;
  margin-top: 150px;
  .tags {
    .tag {
      color: #8a8888;
      padding: 10px;
      margin: 10px;
    }
    .tag:first-child {
      margin-left: 0;
    }
  }
`;
const DashbordComponenet = () => {
  return (
    <DshbordComponenetStyle>
      <div className="tags">
        {[
          "Dash board",
          "Posts",
          "Edit profile",
          "Subscription",
          "Billing address",
          "Submit post",
        ].map((e, i) => {
          return (
            <motion.span
              whileHover={{ color: "#f8f8f8" }}
              className="tag"
              onClick={() => {
                console.log(e);
              }}
            >
              {e}
            </motion.span>
          );
        })}
      </div>
      <div className="view">
        <span className="ekr">{view}</span>
      </div>
    </DshbordComponenetStyle>
  );
};

export default DashbordComponenet;
